import './Nav.css';

function Nav(){
    return (
        <nav className="nav">
         
            <p id="btn1" className="btnNav"><a href="./Index.html#aboutUs">nosotros</a></p>
            <p id="btn2" className="btnNav"><a href="./Index.html#news">noticias</a></p>        
            <p id="btn3" className="btnNav"><a href="./Index.html#contact">Ayuda</a></p>
            <p id="btnLoginUser">Ingresar</p>
        </nav>
    )
}
export default Nav;
